$(window).load(init);

function init()
{
	initiateDayMap();
}
function initiateDayMap () 
{
	
	mapboxgl.accessToken = 'pk.eyJ1IjoiZGFtbGFjYXkiLCJhIjoiTk0wWGsxTSJ9.pY0Vqxj_3CGpofPC2PSjww';

	_GLOBAL.map = new mapboxgl.Map({
		container: 'map',
		style: _GLOBAL.standardLayer,
		center: [28.944265, 41.021574], // starting position
		zoom: 11 // starting zoom
	});
	_GLOBAL.map.on('load', ready);

	
	$(window).resize(windowResize);
	windowResize();
}
function windowResize()
{
	var w=window,d=document,e=d.documentElement,g=d.getElementsByTagName('body')[0],x=w.innerWidth||e.clientWidth||g.clientWidth,y=w.innerHeight||e.clientHeight||g.clientHeight;
	_GLOBAL.dw=x;
	_GLOBAL.dh=y;
	$("#map").height(y);
}
function ready()
{
	_GLOBAL.socket=io.connect(_GLOBAL.socketURL);
	
	//_GLOBAL.socket.on('initialConditions', gotInitData);
	gotInitData(_GLOBAL.data);
}
function gotInitData(data)
{
	//console.log("gotInitData", data);
	//console.log(JSON.stringify(data));
	var i;
	
	

	_GLOBAL.weather=new WeatherLayer(_GLOBAL.map);
	_GLOBAL.weather.init();
	//for(i=0; i<data.twitter.length; i++)
	//	console.log(data.twitter[i].lat,",", data.twitter[i].lng);
	_GLOBAL.crowd=new CrowdLayer(_GLOBAL.map);
	_GLOBAL.crowd.init(data.twitter);	

	_GLOBAL.event=new EventLayer(_GLOBAL.map);
	_GLOBAL.event.init();
	_GLOBAL.event.setData(data.events);
	
	_GLOBAL.map.on('zoomend', zoomChanged);
	_GLOBAL.map.on('zoomstart', function(e){_GLOBAL.weather.zoomStart();});

	
	$(".map-zoom .zoom-in").click(function(){_GLOBAL.map.flyTo({zoom:_GLOBAL.map.getZoom()+1});});
	$(".map-zoom .zoom-out").click(function(){_GLOBAL.map.flyTo({zoom:_GLOBAL.map.getZoom()-1});});

}


function toggleCrowd(value)
{
	if(value)
		_GLOBAL.crowd.show();
	else
		_GLOBAL.crowd.hide();
}
function toggleEvent(value)
{
	if(value)
		_GLOBAL.event.show();
	else
		_GLOBAL.event.hide();
}
function toggleTraffic(value)
{
	if(value)
		_GLOBAL.map.setStyle(_GLOBAL.trafficLayer);
	else
		_GLOBAL.map.setStyle(_GLOBAL.standardLayer);
}
function toggleWeather(value)
{
	if(value)
		_GLOBAL.weather.show();
	else
		_GLOBAL.weather.hide();
}
function zoomChanged(e)
{
	var zoom=_GLOBAL.map.getZoom();
	var changed=false;
	//console.log(zoom);
	if(zoom<=12)
	{
		if(_GLOBAL.event.mapLevel!=0)
		{
			_GLOBAL.event.mapLevel=0;
			changed=true;
		}
	}
	else if(zoom<=14)
	{
		if(_GLOBAL.event.mapLevel!=1)
		{
			_GLOBAL.event.mapLevel=1;
			changed=true;
		}
	}
	else
	{
		if(_GLOBAL.event.mapLevel!=2)
		{
			_GLOBAL.event.mapLevel=2;
			changed=true;
		}
	}
	if(changed)
	{
		_GLOBAL.event.updateMarkers();
		
	}
	_GLOBAL.crowd.update(zoom);
	_GLOBAL.weather.resize();
}

function convertDate(inputFormat) 
{
	var d = new Date(inputFormat);
	return [pad(d.getDate()), pad(d.getMonth()+1), d.getFullYear()].join('/');
};
function pad(s) 
{
    return (s < 10) ? '0' + s : s;
}
